INSERT INTO `journal_encounter_section_locale` (`ID`, `locale`, `Title_lang`, `BodyText_lang`, `VerifiedBuild`) VALUES
(30861, 'zhCN', '伤害输出者', '$bullet;应该诱使纵火者远离团队。|cFF2959D3|Hspell:464983|h[炙烤]|h|r的爆炸范围很大，并会造成高额伤害。\n$bullet;烈焰行者被击败前会施放|cFF2959D3|Hspell:470164|h岩浆灌注]|h|r，使玩家难以在钢铁大厅中移动。\n$bullet;玩家需要尽快摧毁传送锚点，并且阻止燃烧之灵成功施放|cFF2959D3|Hspell:464769|h[火焰之地的愤怒]|h|r。', 57534),
(30900, 'zhCN', '综述', '达格兰·索瑞森大帝和铁炉堡公主茉艾拉·铜须都是令人敬畏的勇士。茉艾拉的|cFF2959D3|Hspell:466504|h[暗言术：谴]|h|r和|cFF2959D3|Hspell:470599|h[暗言术：疽]|h|r必须小心应对，否则会逐渐压垮团队。茉艾拉会尝试用|cFF2959D3|Hspell:470605|h[辉煌灌注]|h|r治疗达格兰。\n\n达格兰是危险的近战斗士，会使用|cFF2959D3|Hspell:465077|h[召唤皇家守卫]|h|r和|cFF2959D3|Hspell:465079|h[召唤暮光之锤特使]|h|r来击退入侵者。茉艾拉被击败后，达格兰会变形为强大的|cFF2959D3|Hspell:465069|h[烈焰化身]|h|r，强化他的所有技能。\n\n孤注一掷时，达格兰会|cFF2959D3|Hspell:466332|h[乞求炎魔之王]|h|r拯救他。拉格纳罗斯的影像会肆意破坏，逐渐让整个房间被熔岩之火淹没，直到达格兰被击败。拉格纳罗斯加入战斗后，达格兰不会再召唤皇家守卫或暮光之锤特使。', 57534),
