(30887, 'zhCN', '燃烧之魂', '', 57534),
(30722, 'zhCN', '综述', '洛考尔对其目标施放|cFF2959D3|Hspell:462351|h[激荡岩浆]|h|r，造成伤害并为|cFF2959D3|Hspell:463674|h[晶化]|h|r他的黑曜后嗣提供原材料。\n\n当洛考尔的生命值降至95%以及之后每损失20%生命值时，他都会施放|cFF2959D3|Hspell:462322|h[喷发]|h|r，使整个房间充满|cFF2959D3|Hspell:462351|h[激荡岩浆]|h|r。每个到达目的地的|cFF2959D3|Hspell:462346|h[活体岩浆]|h|r都会增强由|cFF2959D3|Hspell:462320|h[火成结晶]|h|r创造的元素生物的力量。\n\n当达到100能量时，洛考尔会施放|cFF2959D3|Hspell:462317|h[熔火剧变]|h|r，对所有玩家造成巨大伤害。', 57534),
(5499, 'zhCN', '次级暗影裂隙', '高阶术士奈瑟库斯在一名玩家脚下制造吞噬裂隙，并每$30498t1秒对裂隙中的玩家造成$30498s1点暗影伤害。', 57534),
(30988, 'zhCN', '第27部分', '', 57534),
(30760, 'zhCN', '第5部分', '', 57534),
(4910, 'zhCN', '箭雨', '伊琳娜·暗木向$30933A1码区域内的所有玩家进行一轮乱射。乱射每$448891t1秒造成$448891s1点奥术伤害，持续$30933d。', 57534);
INSERT INTO `keystone_affix_locale` (`ID`, `locale`, `Name_lang`, `Description_lang`, `VerifiedBuild`) VALUES
(158, 'zhCN', '萨拉塔斯的交易：虚缚', '战斗中，萨拉塔斯会召唤虚空大使。虚空大使会强化附近的敌人。', 57534),
(147, 'zhCN', '萨拉塔斯的狡诈', '萨拉塔斯背叛玩家，取消她的交易，并使敌人的生命值和伤害提高10%。', 57534),
(152, 'zhCN', '挑战者的危境', '计时增加90秒，但死亡会从剩余时间里扣除15秒。', 57534);
