(2265, 'zhCN', '鎏金雷龙', '|cFFFFD200游戏商城|r', '摩尔登和吉利亚以前从没想过，他们与各大阵营建立贸易合作关系居然真能大赚一笔。直到有一天，他们居然买得起这样华贵的生物来给自己的旅途增添便利，当然，还得是鎏金版的。', 57534),
(2203, 'zhCN', '卡多雷战狼', '|cFFFFD200特殊|r', '卡多雷部队在一次突袭中捕获了它。狼的忠诚，往往只献给最强者。', 57534),
(2199, 'zhCN', '黑石战刃豹', '|cFFFFD200特殊|r', '一队黑石前锋发现一窝夜刃豹幼崽后，把它们训练成了令人闻风丧胆的致命坐骑。', 57534);
